import React from 'react';
import '../components/assets/m'
const ModalEvento = ({ evento, onClose }) => {
  return (
    <div className="modal">
      <div className="modal-content">
        <span className="close" onClick={onClose}>&times;</span>
        <h2>{evento.nombreActiividad}</h2>
        <p>Hora de inicio: {evento.horaInicioActividad}</p>
        <p>Modalidad: {evento.modalidad}</p>
        <p> Ubicacion: {evento.ubicacionActividad}</p>
        {/* Agrega aqu√≠ cualquier otro dato que quieras mostrar */}
      </div>
    </div>
  );
};

export default ModalEvento;
